import React from 'react';
import s from './Header.module.css';

const Header = () => {
    return <header className={s.header}>
        <a href="https://www.youtube.com/channel/UCTW0FUhT0m-Bqg2trTbSs0g" target="_blank">
        <img src="/home/user/Screenshots/Logotype.xcf" />
        </a>
    </header>
}


export default Header;
